import React, { useState, useEffect } from "react";

export default function SettingsForm() {
    const user = JSON.parse(localStorage.getItem("user"));
    const userID = user.user_id || localStorage.getItem('userId');
    const [surveyData, setSurveyData] = useState({});
    console.log("userID in SettingsForm.js ", userID);
    console.log("User in SettingsForm.js: ", user);

    useEffect(() => {
        const fetchSurveyData = async () => {
            try {
                const response = await fetch(`http://localhost:3001/surveyfetch/${userID}`);
                if (!response.ok) {
                    throw new Error('Network response was not ok');
                }
                const data = await response.json();
                console.log("Data from DB: ",data.surveyData);
                setSurveyData(data.surveyData[0]);
            } catch (error) {
                console.error('Error fetching survey data:', error);
            }
        };

        if (userID) {
            fetchSurveyData();
        }
    }, [userID]);

    const handleDeleteAccount = () => {
        // Logic to show confirmation modal for account deletion.
    };

    return (
        <div className="container">
          <div className="row">
            <div className="col-md-3 bg-light vh-100"> {/* Sidebar */}
              {/* Your sidebar content here */}
            </div>
            <div className="col-md-9 py-4"> {/* Main content */}
              <div className="settings-form bg-white p-4 shadow-sm">
                <h2 className="mb-4">Settings</h2>

                <div className="row g-3">
                  {/* First Name Field */}
                  <div className="col-md-6">
                    <label className="form-label">*First Name:</label>
                    <input type="text" className="form-control" placeholder="Name" />
                  </div>

                  {/* Last Name Field */}
                  <div className="col-md-6">
                    <label className="form-label">*Last Name:</label>
                    <input type="text" className="form-control" placeholder="Name" />
                  </div>

                  {/* Email Field */}
                  <div className="col-md-6">
                    <label className="form-label">*Email:</label>
                    <input type="email" className="form-control" placeholder="name@email.com" />
                  </div>

                  {/* Password Field */}
                  <div className="col-md-6">
                    <label className="form-label">*Password:</label>
                    <input type="password" className="form-control" placeholder="********" />
                  </div>

                  {/* Role Field */}
                  <div className="col-12">
                    <label className="form-label">*Role:</label>
                    <select className="form-select">
                      <option>Client</option>
                      <option>Coach</option>
                      {/* Add other roles as necessary */}
                    </select>
                  </div>

                  {/* Fitness Level Field */}
                  <div className="col-12">
                    <label className="form-label">Fitness Level:</label>
                    <select className="form-select">
                      <option>Beginner</option>
                      <option>Intermediate</option>
                      <option>Advanced</option>
                    </select>
                  </div>

                  {/* ... Additional fields ... */}

                  {/* Save Button */}
                  <div className="col-12">
                    <button className="btn btn-primary">Save</button>
                  </div>

                  {/* Delete Account Button */}
                  <div className="col-12">
                    <button className="btn btn-danger" onClick={handleDeleteAccount}>Delete Account</button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      );
}
